#include <iostream>
#include <vector>
#include <queue>

using namespace std;

bool isValid(int x, int y, int K, int N) {
    return x >= 0 && y >= 0 && x < K && y < N;
}

bool canReach(int K, int N, int j, int i, int m, int s) {
    vector<pair<int, int>> moves = {{-2, -1},
                                    {-2, 1},
                                    {-1, -2},
                                    {-1, 2},
                                    {1,  -2},
                                    {1,  2},
                                    {2,  -1},
                                    {2,  1}};

    vector<vector<bool>> visited(K, vector<bool>(N, false));
    queue<pair<int, int>> q;
    q.emplace(j - 1, i - 1);
    visited[j - 1][i - 1] = true;

    while (!q.empty()) {
        auto [x, y] = q.front();
        q.pop();

        if (x == m - 1 && y == s - 1) return true;

        for (auto &move: moves) {
            int nx = x + move.first, ny = y + move.second;
            if (isValid(nx, ny, K, N) && !visited[nx][ny]) {
                visited[nx][ny] = true;
                q.emplace(nx, ny);
            }
        }
    }

    return false;
}

int main() {
    int K, N, j, i, m, s;
    cin >> K >> N >> j >> i >> m >> s;

    if (canReach(K, N, j, i, m, s))
        cout << "YES" << endl;
    else
        cout << "NO" << endl;

    return 0;
}

#include <iostream>
#include <vector>
#include <queue>
#include <algorithm>

using namespace std;

int main() {
    int n;
    cin >> n;

    vector<vector<int>> graph(n + 1);
    vector<int> distance(n + 1, -1);

    for (int i = 2; i <= n; ++i) {
        int parent;
        cin >> parent;
        graph[parent].push_back(i);
    }

    queue<int> q;
    q.push(1);
    distance[1] = 0;

    while (!q.empty()) {
        int current = q.front();
        q.pop();

        for (int child: graph[current]) {
            if (distance[child] == -1) {
                distance[child] = distance[current] + 1;
                q.push(child);
            }
        }
    }

    int maxDistance = *max_element(distance.begin(), distance.end());
    vector<int> farthestNodes;
    for (int i = 1; i <= n; ++i) {
        if (distance[i] == maxDistance) {
            farthestNodes.push_back(i);
        }
    }

    cout << maxDistance << endl;
    cout << farthestNodes.size() << endl;
    for (int node: farthestNodes) {
        cout << node << " ";
    }
    cout << endl;

    return 0;
}

#include<bits/stdc++.h>

using namespace std;

void solve(int t) {
	int r1, r2, h, p; cin >> r1 >> r2 >> h >> p;
	double r = r1 - ((r1 - r2) / h * (h - p));
	double x = (r1 * h) / (r1 - r2);

	double ans = (acos(-1) / 3) * ((r * r * (x - h + p)) - (r2 * r2 * (x - h)));
	printf("Case %d: %0.9f\n", t, ans);

}

int32_t main() {
	ios_base::sync_with_stdio(0);
	cin.tie(0);
	int T = 1; cin >> T;
	for (int i = 1; i <= T; i++) {
		solve(i);
	}
}

using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class TestWhile : MonoBehaviour
{
    List<Vector3> positions = new List<Vector3>();
    
    void Start()
    {
        StartCoroutine(test());
    }
    
    IEnumerator Spawn(Vector3 p)
    {
        GameObject obj = GameObject.CreatePrimitive(PrimitiveType.Cube);
        
        obj.transform.position = p;
        
        index += 0.5f;

        yield return null;
    }


    float index = 0;
    IEnumerator test()
    {
        do
        {

            var listDir  = new List<Vector3> { 
                Vector3.up, 
                Vector3.down, 
                Vector3.left, 
                Vector3.right, 
                Vector3.forward, 
                Vector3.back,

                Vector3.up+Vector3.left,
                Vector3.up+Vector3.right,

                Vector3.down+Vector3.left,
                Vector3.down+Vector3.right,

                Vector3.up+Vector3.forward,
                Vector3.up+Vector3.back,

                Vector3.down+Vector3.forward,
                Vector3.down+Vector3.back,

                Vector3.left+Vector3.forward,
                Vector3.left+Vector3.back,

                Vector3.right+Vector3.forward,
                Vector3.right+Vector3.back,
            };

            var randomDirection = listDir[Random.Range(0, listDir.Count)] * index;

            if (!positions.Contains(randomDirection)) {
                positions.Add(randomDirection);
               
                yield return Spawn(randomDirection);
            }
            else
                yield return null;
        } 
        while (true);
    }

}

using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class TestWhile : MonoBehaviour
{
    [SerializeField] GameObject prefabs;
    [SerializeField] int Max = 400;
    
    List<Vector3> positions = new List<Vector3>();
    
    void Start()
    {
        StartCoroutine(test());
    }
    
    IEnumerator Spawn(Vector3 p)
    {
        Instantiate(prefabs, p, Quaternion.identity);

        yield return null;
    }
    
    IEnumerator test()
    {
        do
        {
            if (positions.Count >= Max)
                break;
            
            var position_random = new Vector3(
                Random.Range(-10, 10), 0, Random.Range(-10, 10));

            if (!positions.Contains(position_random)) {
                positions.Add(position_random);
                yield return Spawn(position_random);
            }
            else
                yield return null;

        } 
        while (true);
    }

}

